import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';
import { isAuthenticated, logout } from './auth';
import '../styles.css';

const ContractList = () => {
  const [contracts, setContracts] = useState([]);
  const [secretariat, setSecretariat] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    if (!isAuthenticated()) {
      navigate('/login');
      return;
    }

    const fetchContracts = async () => {
      try {
        const response = await axios.get('http://192.168.1.110:5000/api/contracts', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
          params: { secretariat: secretariat || undefined },
        });
        console.log('Resposta do backend (contratos):', {
          count: response.data.length,
          contracts: response.data.map(c => ({
            id: c.id,
            secretariat: c.secretariat,
            contract_number: c.contract_number,
            alert_status: c.alert_status,
          })),
        });
        setContracts(response.data);
      } catch (err) {
        console.error('Erro ao carregar contratos:', err.response?.data || err.message);
        if (err.response?.status === 401) {
          logout();
          navigate('/login');
        }
      }
    };

    fetchContracts();
  }, [navigate, secretariat]);

  const handleDelete = async (id) => {
    if (window.confirm('Tem certeza que deseja excluir este contrato?')) {
      try {
        await axios.delete(`http://192.168.1.110:5000/api/contracts/${id}`, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        setContracts(contracts.filter((contract) => contract.id !== id));
      } catch (err) {
        console.error('Erro ao excluir contrato:', err.response?.data || err.message);
        alert('Erro ao excluir contrato');
      }
    }
  };

  return (
    <div className="contract-list-container">
      <h2>Lista de Contratos</h2>
      <div className="controls">
        <Link to="/contracts/new" className="new-contract-button">
          Novo Contrato
        </Link>
        <input
          type="text"
          placeholder="Filtrar por secretaria"
          value={secretariat}
          onChange={(e) => setSecretariat(e.target.value)}
          className="filter-input"
        />
        <button
          onClick={() => {
            logout();
            navigate('/login');
          }}
          className="logout-button"
        >
          Sair
        </button>
      </div>
      <table className="contract-table">
        <thead>
          <tr>
            <th>Secretaria</th>
            <th>Nº do Contrato</th>
            <th>Data de Início</th>
            <th>Data de Término</th>
            <th>Status</th>
            <th>Tipo de Processo</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {contracts.map((contract) => (
            <tr key={contract.id} className={contract.alert_status}>
              <td>{contract.secretariat}</td>
              <td>{contract.contract_number}</td>
              <td>{new Date(contract.start_date).toLocaleDateString()}</td>
              <td>{new Date(contract.end_date).toLocaleDateString()}</td>
              <td>{contract.alert_status}</td>
              <td>{contract.process_type}</td>
              <td>
                <Link to={`/contracts/edit/${contract.id}`} className="edit-button">
                  Editar
                </Link>
                <button
                  onClick={() => handleDelete(contract.id)}
                  className="delete-button"
                >
                  Excluir
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ContractList;
